import java.io.*;import java.util.HashSet;import java.util.StringTokenizer;// نورت الكود يا كبير اتفضل // يا رب Acceptedpublic class ValeriiAgainstEveryone {    public static void main(String[] args) {        FastReader in = new FastReader();        PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));         int t = in.nextInt();        while (t-- > 0) {            int n = in.nextInt();            HashSet<Integer> set = new HashSet<>();            for (int i = 0; i < n; i++)                set.add(in.nextInt());            out.println((set.size() == n) ? "NO" : "YES");        }         out.close();    }     private static class FastReader {        BufferedReader br;        StringTokenizer st;         FastReader() {            br = new BufferedReader(new                    InputStreamReader(System.in));        }         String next() {            while (st == null || !st.hasMoreElements()) {                try {                    st = new StringTokenizer(br.readLine());                } catch (IOException e) {                    e.printStackTrace();                }            }            return st.nextToken();        }         int nextInt() {            return Integer.parseInt(next());        }    }}
